import React from "react";
import { PrimeReactProvider } from "primereact/api";
import { Menubar } from "primereact/menubar";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  useNavigate,
} from "react-router-dom";
import AboutMe from "./pages/AboutMe"; // Import AboutMe component
import Experience from "./pages/Experience"; // Import Experience component
import Projects from "./pages/Projects"; // Import Projects component
import "primereact/resources/themes/lara-light-cyan/theme.css";
import "./App.css";

const App = () => {
  const navigate = useNavigate();

  const items = [
    {
      label: "About Me",
      command: () => navigate("/about"),
    },
    {
      label: "Experience",
      command: () => navigate("/experience"),
    },
    {
      label: "Projects",
      command: () => navigate("/projects"),
    },
  ];

  return (
    <PrimeReactProvider>

    </PrimeReactProvider>
  );
};

const AppWithRouter = () => (
  <Router>
    <App />
  </Router>
);

export default AppWithRouter;
